                "Accepts": "application/json"
            },
            body: JSON.stringify(favQuote)
        }
        fetch("http://localhost:3000/favQuotes", config)
            .then(res => res.json())
            .then(data => console.log(data))
    }
    return (
        <div className="quotes-page">
            <h1>{quote.quote}</h1>
            <h1> - {quote.author}</h1>
